export default function Card() {
  return (
    <section className='card'>
        <h2>КАРТОЧКА УЧЕТА ОСНОВНЫХ СВЕДЕНИЙ <br/> ООО «ТД МТК»</h2>
        <table className='table'>
            <thead>
                <th></th>
            </thead>
        </table>




    </section>
  )
}
